    return (
      <div>
        <Sidebar title={"Users"} />






      <Card>
      <Card.Body>
        <Row>
          <Col md={3}>
            <h3>Filtros:</h3>
            <Form.Group>
              <Form.Label>Rol:</Form.Label>
              <Form.Control
                as="select"
                value={roleFilter}
                onChange={handleRoleFilterChange}
              >
                <option value="">Todos</option>
                <option value="Admin">Admin</option>
                <option value="Atleta">Atleta</option>
                <option value="Trainer">Trainer</option>
              </Form.Control>
            </Form.Group>
          </Col>
          <Col md={9}>
            <h3>Usuarios:</h3>
            <Table striped bordered hover>
              <thead>
                <tr>
                  <th>Id</th>
                  <th>Nombre</th>
                  <th>Rol</th>
                </tr>
              </thead>
              <tbody>
                {getFilteredUsers().map((user) => (
                  <tr key={user.id}>
                    <td>{user.id}</td>
                    <td>{user.name}</td>
                    <td>{user.rol}</td>
                  </tr>
                ))}
              </tbody>
            </Table>
          </Col>
        </Row>
      </Card.Body>
    </Card>      
